import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Data from "./Data/Data";

function App() {
  let language ='geo'


  return (
    <Router>
      <Routes>
        <Route path="/:{language}" element={<Data />} />

      </Routes>
    </Router>
  );
}

export default App;
